class Processor:
    def get_data(self, data, applications, request):
        """      DataFrame  ."""

        results = []
        for _, application in applications.iterrows():
            company_id = application['_id']
            year = application['year']

            company_data = data[data['_id'] == company_id].copy()
            registration_date = pd.to_datetime(company_data[' '].iloc[0]).year

            row_results = {}
            for req_item in request:
                field_name = req_item['field_name']
                prev = req_item.get('prev', 0)
                last_available = req_item.get('last_available')

                if field_name == " , years":
                    row_results[field_name] = year - registration_date
                    continue

                target_year = year - prev
                column_name = f"{field_name} {target_year}"

                if column_name in company_data.columns:
                    value = company_data[column_name].iloc[0]
                    if last_available and pd.isna(value):
                        for k in range(1, last_available +1):
                            prev_year = target_year - k
                            prev_column_name = f"{field_name} {prev_year}"
                            if prev_column_name in company_data.columns and not pd.isna(company_data[prev_column_name].iloc[0]):
                                value = company_data[prev_column_name].iloc[0]
                                break

                    if field_name == " ()  , RUB":
                        revenue_col = f", RUB {target_year}"
                        cost_col = f"  {target_year}"
                        mgmt_col = f"  {target_year}"
                        comm_col = f"  {target_year}"

                        if all(col in company_data.columns for col in [revenue_col, cost_col, mgmt_col, comm_col]):
                            value = (company_data[revenue_col].iloc[0] -
                                     company_data[cost_col].iloc[0] -
                                     company_data[mgmt_col].iloc[0] -
                                     company_data[comm_col].iloc[0])
                        else:
                            value = np.nan


                    row_results[f"{field_name} {year - prev}"] = value
                else:
                    row_results[f"{field_name} {year - prev}"] = np.nan

            results.append(row_results)

        return pd.DataFrame(results)


